window.bookSummaryJSON = "<p>Songstress Ava Rose steps out on faith and moves to New York to pursue her dreams of getting her singing career to the big stage. After two years of hustling for her big break with no luck, she literally runs into the man who can help make her dreams a reality. As she soon discovers, he could also be the man of her dreams.</p> <p>Brooklyn-born superstar and icon in the making, Chauncey Grey, appears to have a life anyone would hope for. His money, millions of fans and unfaltering good looks affords him to live his life on his terms. However, when his battles with friends and past romantic relationships come to light, they threaten to derail his chances of being with the one woman he discovers he can't live without.</p> <p>Together, both Ava Rose and Chauncey discover, What You Do for Love.</p>"; 
